INSERT INTO `report` VALUES (4,'Debtors',8,'','Customer Number','','','','','text','','','','','','','','','','select operator.name as NAME,sum(AMOUNT_DUE) as `AMOUNT DUE` from invoice inner join operator on operator.id=invoice.operator_id ','operator.customer_code','','','','','=','=','=','=','=','amount_paid=0','','operator.name',NULL),(9,'Numbers Issued',5,'','From','To','','','','date','date','','','','From','To','','','','select numbering_resource_type.name as TYPE,num as NUMBER,operator.name as NAME,DATE_FORMAT(assignment_date,\'%d-%m-%Y\') as DATE from numbering_resource inner join operator on operator.id=numbering_resource.operator_id inner join numbering_resource_type on numbering_resource_type.id=numbering_resource.numbering_resource_type_id','numbering_resource.assignment_date','numbering_resource.assignment_date','','','','>=','<=','=','=','=','','','','No'),(11,'Amateur Operators',6,'','','','','','','','','','','','','','','','','SELECT region.name as REGION,operator.name as OPERATOR,call_sign as CALL_SIGN,DATE_FORMAT(licence_date,\'%d-%m-%Y\') as LICENCE_DATE FROM frequency_station inner join region on frequency_station.region_id=region.id\r\ninner join operator on operator.id=frequency_station.operator_id','','','','','','=','=','=','=','=','status=\'in use\'',NULL,NULL,NULL),(12,'Courier Operators',4,'','','','','','','','','','','','','','','','','SELECT licence_category.name as TYPE,operator.name as NAME,DATE_FORMAT(issue_date,\'%d-%m-%Y\') as ISSUE_DATE,duration as DURATION FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id inner join operator on operator.id=licence_application.operator_id ','','','','','','=','=','=','=','=','is_licence=1 and licence_application.licence_category_id between 5 and 10 order by licence_application.licence_category_id desc',NULL,NULL,NULL),(13,'Active Construction Permits',7,'','','','','','','','','','','','','','','','','SELECT operator.name as NAME,cp_number as `CP NUMBER`,DATE_FORMAT(cp_issue_date,\'%d-%m-%Y\') as `ISSUE DATE`,DATE_FORMAT(cp_expiry_date,\'%d-%m-%Y\') as `EXPIRY DATE` FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id inner join operator on operator.id=licence_application.operator_id ','','','','','','=','=','=','=','=','cp_issue_date is NOT NULL and CURDATE() >= cp_issue_date and CURDATE()<=cp_expiry_date',NULL,NULL,NULL),(14,'Expired Construction Permit',7,'','','','','','','','','','','','','','','','','SELECT operator.name as NAME,cp_number as `CP NUMBER`,DATE_FORMAT(cp_issue_date,\'%d-%m-%Y\') as `ISSUE DATE`,DATE_FORMAT(cp_expiry_date,\'%d-%m-%Y\') as `EXPIRY DATE` FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id inner join operator on operator.id=licence_application.operator_id','','','','','','=','=','=','=','=','cp_issue_date is NOT NULL  and CURDATE()>cp_expiry_date',NULL,NULL,NULL),(15,'Active NF,NS and AS licences',4,'','','','','','','','','','','','','','','','','SELECT operator.name as NAME,licence_category.name as TYPE,market_segment.name as `MARKET SEGMENT`,DATE_FORMAT(issue_date,\'%d-%m-%Y\') as `ISSUE DATE`,duration as DURATION,licence_application.num as `LICENCE NUMBER` FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id inner join operator on operator.id=licence_application.operator_id inner join market_segment on market_segment.id=licence_application.market_segment_id','','','','','','=','=','=','=','=','is_licence=1 and licence_application.licence_category_id between 1 and 3 ','licence_application.licence_category_id,licence_application.market_segment_id','',NULL),(16,'Expired NF,NS and AS licences',4,'','','','','','','','','','','','','','','','','SELECT operator.name as NAME,licence_category.name as TYPE,market_segment.name as `MARKET SEGMENT`,DATE_FORMAT(issue_date,\'%d-%m-%Y\') as `ISSUE DATE`,duration as DURATION,licence_application.num as `LICENCE NUMBER`  FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id inner join operator on operator.id=licence_application.operator_id inner join market_segment on market_segment.id=licence_application.market_segment_id','','','','','','=','=','=','=','=','is_licence=1 and (licence_application.licence_category_id between 1 and 3 ) and licence_application.status =\'Expired\'','licence_application.licence_category_id,licence_application.market_segment_id','',NULL),(17,'Complaints by Sector',3,'','from','to','','','','date','date','','','','','','','','','select complaint_sector.name as Sector,count(*) as Total from complaint_sector,complaint','verification_tcra_date','verification_tcra_date','','','','>=','<=','=','=','=','complaint_sector.id=complaint.sector_id ','','complaint_sector.name',NULL),(18,'Licence Application By Status - NF,NS,AS',4,'','','','','','','','','','','','','','','','','SELECT licence_category.name as TYPE,licence_application.status as STATUS,count(licence_application.id) as TOTAL FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id ','','','','','','=','=','=','=','=','is_licence is null and licence_application.licence_category_id between 1 and 3 group by licence_category.name,licence_application.status','licence_application.licence_category_id desc','',NULL),(19,'Licence Application By Status - Postal, Courier',4,'','','','','','','','','','','','','','','','','SELECT licence_category.name as TYPE,licence_application.status as STATUS,count(licence_application.id) as TOTAL FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id  ','','','','','','=','=','=','=','=','is_licence is null and licence_application.licence_category_id between 5 and 10 group by licence_category.name,licence_application.status','licence_application.licence_category_id desc',NULL,NULL),(20,'Complaints By Sector, Region',3,'','from','to','','','','date','date','','','','','','','','','select complaint_sector.name as Sector,region.name as Region, count(*) as Total from complaint_sector,complaint,region','verification_comp_date','verification_comp_date','','','','>=','<=','=','=','=','complaint_sector.id=complaint.sector_id and region.id=complaint.region_id','','complaint_sector.name,region.name',NULL),(21,'Telecom Traffic Monthly for a given  quater - Operator',1,'','Year','Quarter','Month','','','year','quarter','text','','','Year','Quarter','Month','','','SELECT view_telecom_traffic.OPERATOR, view_telecom_traffic.YEAR, view_telecom_traffic.MONTH, Sum(view_telecom_traffic.`On Net`) AS `On Net`, Sum(`Outgoing to other Mobile`+`Outgoing to other Fixed`) AS `Off Net National`, Sum(`Outgoing to East Africe Mobile`+`Outgoing to East Africa Fixed`) AS `Off Net EA`, Sum(`Outgoing to Other International Mobile`+`Outgoing to Other International Fixed`) AS `Off Net International`\r\nFROM view_telecom_traffic\r\n','YEAR','MONTH','MONTH','','','=','=','=','=','=','','operator,year, MONTH(str_to_date(concat(\'12-\',month,\'-2001\'),\'%d-%M-%Y\'))','view_telecom_traffic.OPERATOR, view_telecom_traffic.YEAR, view_telecom_traffic.MONTH','Yes'),(22,'Compliants By Region',3,'','from','to','','','','date','date','','','','','','','','','select region.name as Region,count(*) as Total from region,complaint ','verification_tcra_date','verification_tcra_date','','','','>=','<=','=','=','=','region.id=complaint.region_id','','region.name',NULL),(23,'Active Content Licences',4,'','','','','','','','','','','','','','','','','SELECT operator.name as NAME,licence_category.name as TYPE,market_segment.name as `MARKET SEGMENT`,DATE_FORMAT(issue_date,\'%d-%m-%Y\') as `ISSUE DATE`,duration as DURATION,licence_application.num as `LICENCE NUMBER`  FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id inner join operator on operator.id=licence_application.operator_id inner join market_segment on market_segment.id=licence_application.market_segment_id','','','','','','=','=','=','=','=','is_licence=1 and licence_application.licence_category_id=4','licence_application.licence_category_id,licence_application.market_segment_id','',NULL),(24,'Active Class Licences',4,'','','','','','','','','','','','','','','','','SELECT operator.name as NAME,licence_category.name as TYPE,market_segment.name as `MARKET SEGMENT`,DATE_FORMAT(issue_date,\'%d-%m-%Y\') as `ISSUE DATE`,duration as DURATION,licence_application.num as `LICENCE NUMBER`  FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id inner join operator on operator.id=licence_application.operator_id inner join market_segment on market_segment.id=licence_application.market_segment_id ','','','','','','=','=','=','=','=','is_licence=1 and licence_application.licence_category_id not between 1 and 10','licence_application.licence_category_id,licence_application.market_segment_id','',NULL),(27,'Payment Received',8,'','from','to','Customer Number','','','date','date','text','','','','','','','','select  operator.name as `NAME`,receipt.num as `RECEIPT NUMBER`,receipt.amount_paid as `AMOUNT PAID`,currency.name as CURRENCY,  DATE_FORMAT(receipt.date_paid,\'%d-%m-%Y\') as `DATE` from receipt inner join invoice on invoice.id=receipt.invoice_id inner join operator on operator.id=invoice.operator_id inner join currency on currency.id=receipt.currency_id','receipt.date_paid','receipt.date_paid','operator.customer_code','','','>=','<=','=','=','=','','','',NULL),(28,'Unpaid Invoices',8,'','from','to','Customer Number','','','date','date','text','','','','','','','','select operator.name as `NAME`,invoice.num as `NUMBER`,invoice.amount as `AMOUNT`,currency.name as CURRENCY,  DATE_FORMAT(invoice.day,\'%d-%m-%Y\') as `DATE` from invoice  inner join operator on operator.id=invoice.operator_id inner join currency on currency.id=invoice.currency_id','invoice.day','invoice.day','operator.customer_code','','','>=','<=','=','=','=','amount_paid=0','','',NULL),(29,'Partially Paid Invoices',8,'','from','to','','','','date','date','','','','','','','','','select operator.name as `NAME`,invoice.num as `NUMBER`,invoice.amount_paid as `AMOUNT PAID`,invoice.amount_due as `AMOUNT DUE`,currency.name as CURRENCY,  DATE_FORMAT(invoice.day,\'%d-%m-%Y\') as `DATE` from invoice  inner join operator on operator.id=invoice.operator_id inner join currency on currency.id=invoice.currency_id','invoice.day','invoice.day','','','','>=','<=','=','=','=','amount_paid > 0 and amount_paid < amount','','',NULL),(32,'Frequency',6,'','','','','','','','','','','','','','','','','select operator.name as NAME, frequency_type.name as TYPE,band as `BAND in MHz`,IF (frequency_type.id=1,concat(frequency_1,\' Separation \',separation,\' spacing \',tx_rx_spacing),concat(frequency_1,\' - \',frequency_2,\'U/L \',frequency_3,\' - \',frequency_4,\'D/L \')) as Frequency,total_band_width as `Total Bandwidth` from frequency inner join operator on operator.id=frequency.operator_id inner join frequency_type on frequency_type.id=frequency.frequency_type_id','','','','','','=','=','=','=','=','frequency.status=\'In use\'','operator.name','',NULL),(33,'Licence Application By status - Content',4,'','','','','','','','','','','','','','','','','SELECT licence_category.name as TYPE,licence_application.status as STATUS,count(licence_application.id) as TOTAL FROM licence_application inner join licence_category on licence_category.id=licence_application.licence_category_id ','','','','','','=','=','=','=','=','is_licence is null and licence_application.licence_category_id=4 group by licence_category.name,licence_application.status','licence_application.licence_category_id desc','',NULL),(34,'Licence Application Activity By Status and Date',4,'','fro